import React from "react";
import { Link } from "react-router-dom"; // Import Link from react-router-dom
import "./styles/nav.css";
import logo from "./assets/T.png"; // Import the logo image

const Nav = () => {
  return (
    <div className="navbar">
      <img src={logo} alt="Logo" height="50" /> {/* Logo */}
      <Link to="/">Home</Link> {/* Use Link for Home */}
      <input type="text" placeholder="Search..." /> {/* Search input */}
      <Link to="/trades">Trades</Link> {/* Use Link for Trades */}
      <Link to="/analysis">Analysis</Link> {/* Use Link for Analysis */}
      <Link to="/watchlist">Watchlist</Link> {/* Use Link for Watchlist */}
      <Link to="/account">Account</Link> {/* Use Link for Account */}
    </div>
  );
};

export default Nav;
